import { useState, useEffect } from 'react';
import { BooksList, getNewYorkBooks, getListDetails } from "../src/services/api"
import Card from './components/card/index';
import {ThemeProvider} from 'styled-components'
import theme from './components/styles/theme'
import './App.css';
import { CustomButton } from './components/button/styles';
import Router from './components/container/Router'


function App() {
  const [data, setData] = useState<BooksList[]>([])
  const [dataDetails, setDataDetails] = useState<any[]>([])
  const [showList, setShowList] = useState<boolean>(true)
  useEffect(() => {
    getNewYorkBooks().then(data => {
      if (data) {
        setData(data)
      }
    })
  }, [])

  return (
    <ThemeProvider theme = {theme}>
    <Router/>
    </ThemeProvider>
  );
}

export default App;
